import { useState } from "react";

function Dropdown({ children, name }) {
  const [dropdown, setDropdown] = useState(false);
  return (
    <div>
      <button onClick={() => setDropdown(!dropdown)}>{name}</button>
      {dropdown && children}
    </div>
  );
}

export default Dropdown;
